import React, { useState } from 'react';
import { render } from 'react-dom';

import TimeRange from '../../components/TimelineSlider/App';
import { selectedInterval, timelineInterval } from './datesSource';

const Split = () => {
  const min = 0; // 최소값
  const max = 1000; // 최대값
  const initialPoints = [100, 300, 700, 800, 1000]; // 초기 점의 위치

  const [points, setPoints] = useState(initialPoints);

  const handlePointClick = (index: number) => {
    // 클릭한 점을 업데이트
    const newPoints = [...points];
    newPoints[index] += 50; // 예시로 50 증가
    setPoints(newPoints);
  };
  return (
    <div>
      <div
        style={{
          width: '80vw',
          /* height: '80vh', */
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div
        style={{
          padding: '16px',
          /* height: '20vh', */
          background: '#fff',
          overflowX: 'scroll',
        }}
      >
        <div className="container">
          <TimeRange
            selectedInterval={selectedInterval}
            timelineInterval={timelineInterval}
            min={min}
            max={max}
            points={points}
            onPointClick={handlePointClick}
          />
        </div>
      </div>
    </div>
  );
};

export default Split;
